En buffer er en sekvens af bytes i hukommelsen, og buffering er manipulation af data, der findes i hukommelsen. I .NET-buffering henvises til manipulationen af den ikke-administrerede hukommelse, som er repræsenteret som en række bytes.
Det kan være en god idé at drage fordel af System.Buffer-klassen i .NET, når du har brug for at skrive data direkte til hukommelsen, eller når du vil manipulere data, der er gemt i ikke-administreret hukommelse. Denne artikel taler om, hvordan vi kan arbejde med 
